import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { AnnualWriteOffComponent } from '../annual-write-off.component';
import {
  ApproveAnnualWriteOffComponent
} from 'app/payment/annual-write-off/approve-annual-write-off/approve-annual-write-off.component';

const annualWriteOffRoutes: Routes = [
  {
    path: '',
    component: AnnualWriteOffComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'approve/:annualWriteOffId',
    component: ApproveAnnualWriteOffComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
];


@NgModule({
  imports: [RouterModule.forChild(annualWriteOffRoutes)],
  exports: [RouterModule]
})


export class AnnualWriteOffRoutingModule {
}
